import { useState, useEffect } from "react";

export default function CustomerManagement() {
  const [auth, setAuth] = useState({ username: "", password: "" });
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [customers, setCustomers] = useState([]);
  const [newCustomer, setNewCustomer] = useState({
    firstName: "",
    lastName: "",
    identityNumber: "",
    registeredAt: "",
  });

  const baseUrl = "http://localhost:9090/api";

  const fetchCustomers = async () => {
    const response = await fetch(`${baseUrl}/customers`, {
      headers: {
        Authorization: "Basic " + btoa(`${auth.username}:${auth.password}`),
      },
    });
    const data = await response.json();
    setCustomers(data);
  };

  const handleLogin = async () => {
    try {
      const res = await fetch(`${baseUrl}/customers`, {
        headers: {
          Authorization: "Basic " + btoa(`${auth.username}:${auth.password}`),
        },
      });
      if (res.ok) {
        setIsLoggedIn(true);
        fetchCustomers();
      } else {
        alert("Giriş başarısız");
      }
    } catch {
      alert("Sunucuya bağlanılamadı");
    }
  };

  const handleAddCustomer = async () => {
    const res = await fetch(`${baseUrl}/customers`, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        Authorization: "Basic " + btoa(`${auth.username}:${auth.password}`),
      },
      body: JSON.stringify(newCustomer),
    });
    if (res.ok) {
      setNewCustomer({
        firstName: "",
        lastName: "",
        identityNumber: "",
        registeredAt: "",
      });
      fetchCustomers();
    } else {
      alert("Müşteri eklenemedi");
    }
  };

  if (!isLoggedIn) {
    return (
      <div className="max-w-sm mx-auto mt-20 space-y-4">
        <h2 className="text-xl font-bold text-center">Giriş Yap</h2>
        <input
          className="border p-2 w-full"
          placeholder="Kullanıcı Adı"
          value={auth.username}
          onChange={(e) => setAuth({ ...auth, username: e.target.value })}
        />
        <input
          className="border p-2 w-full"
          type="password"
          placeholder="Şifre"
          value={auth.password}
          onChange={(e) => setAuth({ ...auth, password: e.target.value })}
        />
        <button
          onClick={handleLogin}
          className="bg-blue-600 text-white p-2 w-full rounded"
        >
          Giriş Yap
        </button>
      </div>
    );
  }

  return (
    <div className="max-w-2xl mx-auto mt-10 space-y-6">
      <h2 className="text-2xl font-bold">Yeni Müşteri Ekle</h2>
      <div className="space-y-2">
        <input
          className="border p-2 w-full"
          placeholder="Ad"
          value={newCustomer.firstName}
          onChange={(e) =>
            setNewCustomer({ ...newCustomer, firstName: e.target.value })
          }
        />
        <input
          className="border p-2 w-full"
          placeholder="Soyad"
          value={newCustomer.lastName}
          onChange={(e) =>
            setNewCustomer({ ...newCustomer, lastName: e.target.value })
          }
        />
        <input
          className="border p-2 w-full"
          placeholder="TC Kimlik No"
          value={newCustomer.identityNumber}
          onChange={(e) =>
            setNewCustomer({
              ...newCustomer,
              identityNumber: e.target.value,
            })
          }
        />
        <input
          className="border p-2 w-full"
          placeholder="Kayıt Tarihi (YYYY-MM-DD)"
          value={newCustomer.registeredAt}
          onChange={(e) =>
            setNewCustomer({ ...newCustomer, registeredAt: e.target.value })
          }
        />
        <button
          onClick={handleAddCustomer}
          className="bg-green-600 text-white p-2 w-full rounded"
        >
          Müşteri Ekle
        </button>
      </div>

      <h2 className="text-2xl font-bold mt-10">Kayıtlı Müşteriler</h2>
      <div className="space-y-2">
        {customers.map((c) => (
          <div key={c.id} className="border p-2 rounded">
            <strong>{c.firstName} {c.lastName}</strong><br />
            TC: {c.identityNumber}<br />
            Tarih: {c.registeredAt}
          </div>
        ))}
      </div>
    </div>
  );
}
